var accountId = Get<Guid>("AccountIdParameter");
List<int> timeList = new List<int>(); // список временных промежутков в секундах

// первая проверка контрагента на нахождение в справочнике
var select = new EntitySchemaQuery(UserConnection.EntitySchemaManager, "ICLTimeToNotifyDic");
select.AddAllSchemaColumns();
select.Filters.Add(select.CreateFilterWithParameters(FilterComparisonType.Equal, "ICLAccount", accountId));
select.Filters.Add(select.CreateFilterWithParameters(FilterComparisonType.Equal, "ICLIsCommon", false));
var entities = select.GetEntityCollection(UserConnection);
if (entities.Count > 0) 
{
	foreach (var entity in entities) 
	{
		int temp = GetSeconds(entity);
		if (temp > 0) {
			timeList.Add(temp);
		}
	}
}

if (timeList.Count > 0) 
{
	Set("FlagParameter", true);
	Set("TimeListParameter", ObjectList.Create(timeList));
} 
else 
{
	Set("FlagParameter", false);
}

return true;

var timeList = Get<IObjectList>("TimeListParameter");

foreach (var item in timeList)
{
	ProcessSchema schema = UserConnection.ProcessSchemaManager.GetInstanceByName("ICLSendNotify");
	var flowEngine = new FlowEngine(UserConnection);
	var parameters = new Dictionary<string, string>();
	parameters["TimeToNotifyParameter"] = item.ToString();
	parameters["CaseIdParameter"] = Get<Guid>("CaseIdParameter").ToString();
	parameters["OwnerIdParameter"] = Get<Guid>("OwnerIdParameter").ToString();
	parameters["CaseNumberParameter"] = Get<string>("CaseNumberParameter").ToString();
	parameters["PlanParameter"] = Get<int>("PlanParameter").ToString();
	flowEngine.RunProcess(schema, parameters);
}

return true;

