private int GetSeconds(Entity entity)
{
    // var registeredOn = Get<DateTime>("RegisteredOnParameter"); // Дата регистрации
    // var responseDate = Get<DateTime>("ResponseDateParameter"); // Время реакции

    // TimeSpan time = responseDate - registeredOn; // планируемое время реакции
    // int timeOnSec = (int)time.TotalSeconds; // время в секундах
    
    int timeOnSec = Get<int>("PlanParameter");

    int tempTime = 0; // время уведомления
    var unit = entity.GetTypedColumnValue<Guid>("ICLUnitId"); // тип
    var timeValue = entity.GetTypedColumnValue<int>("ICLValue"); // значение

    if (unit == Guid.Parse("9dac2cd4-6f93-4da2-92ee-da8e2d1724f3")) // Минуты
    {
        tempTime = timeValue * 60;
    }
    else if (unit == Guid.Parse("7a5e5d2d-7400-4469-9674-3a74d6b32de4")) // Проценты 
    {
        tempTime = timeOnSec * timeValue / 100;
    }

    return tempTime;
}

private void TimeConverter(int unitValue)
{
    // минут - * 60
    // часов - * 3600
    // дней - * 86400

    int resolveTimeValue = Get<int>("ResolveTimeValueParameter");
    int tempDate = resolveTimeValue * unitValue;


    Set("PlanParameter", tempDate);

}
